using Backend.Classes;
using Backend.Context;

namespace Backend.Services;

public class DbInitializer(WebShop24DbContext webShop24DbContext)
{
    // Erstelle Datenbank, falls noch nicht erstellt
    public void Initialize()
    {
        if (webShop24DbContext.Database.EnsureCreated())
        {
            InsertDummyDataToDb();
        }
    }

    public async void InsertDummyDataToDb()
    {
        for(int i = 0; i < 9; i++)
        {
            DirectBuyArticle directBuyArticle = new()
            {
                ArticleId = 0,
                UserId = 0,
                Price = 100,
                ArticleName = "Schuh" + i,
                Pictures = ["data:image/jpeg;base64,"],
                Description = "das ist ein schuh"
            };
            webShop24DbContext.Articles.Add(directBuyArticle);
            await webShop24DbContext.SaveChangesAsync();
            DirectBuyArticle directBuyArticle2 = new()
            {
                ArticleId = 0,
                UserId = 0,
                Price = 100,
                ArticleName = "Schuh" + ++i,
                Pictures = ["data:image/jpeg;base64,"],
                Description = "das ist ein schuh"
            };
            webShop24DbContext.Articles.Add(directBuyArticle2);
            await webShop24DbContext.SaveChangesAsync();
        }
    }
}